const App = () => {
    return (
        <ChatEngine
            height = "100vh"
            projectID = "52cc44f5-1679-44e0-80f3-50b329853e98"
            userName = "ndrohith"
            userSecret = "2002"
            renderChatFeed = { (chatAppProps) => <ChatFeed {...chatAppProps} />}
           />

    )

}
export default App;
